import React, { Component } from 'react';
import './Card.css'
import endgame from './endgame.jpg'
class Card extends Component{
	render(){
			console.log(this.props.image);

		return (
				<div className = 'Card'>
					<img src = {require('./endgame.jpg')} alt = {this.props.name} />
					<div className = 'Title'>
						<h3>{this.props.name}</h3> 
					</div>
				</div>	
			)
	}
}

export default Card;
